import axios from "axios"

class TodoDataService{
    retrieveAllTodos(name) {
        return axios.get(`http://localhost:8191/users/${name}/todos`)
    }

    retrieveTodo(name, id) {
        return axios.get(`http://localhost:8191/users/${name}/todos/`)
    }

    deleteTodo(name, id){
        return axios.delete(`http://localhost:8191/users/${name}/todos/${id}`)
    }

}

export default new TodoDataService()
